class Card{
    constructor(id, name, kana, author, date, attr, text, effect){
        this.id = id;
        this.name = name;
        this.kana = kana;
        this.author = author;
        this.date = date;
        this.attr = attr;
        this.text = text;
        this.effect = effect;
        
    }
    
    ToString(){
        return this.name+","+this.kana+","+this.author+","+this.attr+","+this.text+","+this.effect;
    }

    ToType(){
        return "Card";
    }

    display(){
        return `<p class='title'>åå‰ï¼š${this.name}</br>èª­ã¿ï¼š${this.kana}</br>ä½œè€…ï¼š${this.author}</br>æ—¥ä»˜ï¼š${this.date}</p>`;
    }
}

class MonsterCard extends Card{
    constructor(id, name, kana, author, date, attr, text, effect, atk, def){
        super(id, name, kana, author, date, attr, text, effect);
        this.atk = atk;
        this.def = def;
    }
    ToString(){
        return super.ToString()+","+this.atk+","+this.def;
    }

    ToType(){
        return "MonsterCard";
    }
}

